import React, { useState } from 'react';
import axios from 'axios';

function AIAssistantPage() {
  const [input, setInput] = useState('');
  const [output, setOutput] = useState('');

  const getSuggestions = () => {
    axios.post('/api/ai/suggestions', { code: input })
      .then(response => setOutput(response.data.suggestions))
      .catch(error => console.error('Error fetching suggestions:', error));
  };

  const debugCode = () => {
    axios.post('/api/ai/debug', { code: input })
      .then(response => setOutput(response.data.debuggingAdvice))
      .catch(error => console.error('Error debugging code:', error));
  };

  return (
    <div className="container">
      <h1>AI Assistant</h1>
      <textarea
        value={input}
        onChange={e => setInput(e.target.value)}
        placeholder="Paste your code here"
      />
      <button onClick={getSuggestions}>Get Suggestions</button>
      <button onClick={debugCode}>Debug Code</button>
      <pre>{output}</pre>
    </div>
  );
}

export default AIAssistantPage;
